import React, { useEffect, useState } from 'react';
import {
    StyleSheet,
    View,
    Dimensions,
    ScrollView,
    Text,
    TouchableOpacity
} from 'react-native';
import { SvgXml } from 'react-native-svg';
import TopHeaderBar from '../components/TopHeaderBar';
import SideNavBar from '../components/SideNavBar';
import Footer from '../components/Footer';
import Checkbox from '../components/Checkbox';
import Button from '../components/Button';
import Orientation from 'react-native-orientation';

const windowWidth = Dimensions.get('window').width;
const windowHeight = Dimensions.get('window').height;

function Payment(props) {
    const [openSideNav, setOpenSideNav] = useState(false);
    const [selectedPaymentType, setSelectedPaymentType] = useState('');
    const [showPrompt, setShowPrompt] = useState(false);
    const visa = `<svg width="34" height="22" viewBox="0 0 34 22" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect y="0.385254" width="33.9609" height="21.3828" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0_544_4044" transform="translate(0 -0.00438887) scale(0.00078125 0.00124081)"/>
    </pattern>
    <image id="image0_544_4044" width="1280" height="813" xlink:href="data:image/png;base64,"/>
    </defs>
    </svg>
    `;
    const amex = `<svg width="29" height="27" viewBox="0 0 29 27" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect x="0.31543" y="0.289062" width="28.0911" height="25.9948" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0_544_4045" transform="translate(-0.388186 -0.142314) scale(0.00059775 0.00064688)"/>
    </pattern>
    <image id="image0_544_4045" width="3000" height="2000" xlink:href="data:image/png;base64,"/>
    </defs>
    </svg>
    `;
    const master = `<svg width="41" height="25" viewBox="0 0 41 25" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect x="0.210938" y="0.385254" width="40.25" height="23.8984" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0_544_4046" transform="translate(0 -0.00245617) scale(0.000833333 0.00140351)"/>
    </pattern>
    <image id="image0_544_4046" width="1200" height="716" xlink:href="data:image/png;base64,"/>
    </defs>
    </svg>
    `;
    const maestro = `<svg width="41" height="41" viewBox="0 0 41 41" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect x="0.331055" width="40.6693" height="40.6693" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0_544_4047" transform="scale(0.000416667)"/>
    </pattern>
    <image id="image0_544_4047" width="2400" height="2400" xlink:href="data:image/png;base64,"/>
    </defs>
    </svg>
    `;
    const paynow = `<svg width="97" height="29" viewBox="0 0 97 29" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect y="0.669434" width="97" height="28" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0_544_4075" transform="translate(-0.768189 -1.46721) scale(0.00242218 0.00819672)"/>
    </pattern>
    <image id="image0_544_4075" width="1024" height="484" xlink:href="data:image/png;base64,"/>
    </defs>
    </svg>
    `;

    useEffect(() => {
        Orientation.lockToPortrait();
    })

    return (
        <View style={styles.container}>
            {showPrompt ?
                <View style={styles.blackoverlay}>
                    <View style={styles.promptBlock}>
                        <TouchableOpacity style={styles.delete} onPress={() => setShowPrompt(false)}>
                            <Text style={styles.deleteTxt}>&#x2715;</Text>
                        </TouchableOpacity>
                        <Text style={styles.promptTitle}>Congratulation, purchase successful!</Text>
                        <Text style={styles.promptSubtitle}>You may view your purchased courses under Class&nbsp;&nbsp;&gt;&nbsp;&nbsp;Courses</Text>
                        <Button
                            onPress={() => props.navigation.navigate('CourseCatalog')}
                            name={'Got it!'}
                            style={{ backgroundColor: '#45C86D', marginTop: 10, width: '60%' }} />
                    </View>
                </View>
                : null}
            {openSideNav ?
                <SideNavBar
                    setOpenSideNav={setOpenSideNav}
                    navigation={props.navigation}
                    token={props.token}
                    setToken={props.setToken}
                    setIsLoggedIn={props.setIsLoggedIn}
                /> : null}
            <ScrollView contentContainerStyle={styles.contentContainerStyle}>
                <TopHeaderBar
                    navigation={props.navigation}
                    setOpenSideNav={setOpenSideNav}
                    cartQuantity={props.cartQuantity}
                    userRole={props.userRole}
                />
                <View style={styles.paymentWrap}>
                    <Text style={styles.title}>Payment</Text>
                    <Text style={styles.subtitle}>Select Payment Mode:</Text>
                    <View style={styles.paymentMethod}>
                        <View style={{ flexDirection: 'row', alignItems: 'center' }}>
                            <TouchableOpacity style={styles.radioBtn} onPress={() => setSelectedPaymentType('creditcard')}>
                                {selectedPaymentType == 'creditcard' ? <View style={styles.selected}></View> : null}
                            </TouchableOpacity>
                            <Text style={styles.paymentType}>Credit Card (Stripe)</Text>
                        </View>
                        <View style={{ flexDirection: 'row', alignItems: 'center', marginLeft: 50, marginTop: 10 }}>
                            <SvgXml xml={visa} style={styles.icon} />
                            <SvgXml xml={amex} style={styles.icon} width="12%" height="100%" />
                            <SvgXml xml={master} style={styles.icon} />
                            <SvgXml xml={maestro} style={styles.icon} />
                        </View>
                        <Text style={styles.yourcards}>Your cards:</Text>
                        <View style={styles.cardWrap}>
                            <Checkbox />
                            <SvgXml xml={visa} style={[styles.icon, { marginLeft: 10, marginRight: 10 }]} />
                            <View style={styles.censorCardnum}></View>
                            <View style={styles.censorCardnum}></View>
                            <View style={styles.censorCardnum}></View>
                            <View style={styles.censorCardnum}></View>
                            <View style={[styles.censorCardnum, { marginLeft: 10 }]}></View>
                            <View style={styles.censorCardnum}></View>
                            <View style={styles.censorCardnum}></View>
                            <View style={styles.censorCardnum}></View>
                            <View style={[styles.censorCardnum, { marginLeft: 10 }]}></View>
                            <View style={styles.censorCardnum}></View>
                            <View style={styles.censorCardnum}></View>
                            <View style={styles.censorCardnum}></View>
                            <Text style={styles.cardnum}>5678</Text>
                        </View>
                        <TouchableOpacity style={{ marginLeft: 50, marginTop: 15 }} onPress={() => props.navigation.navigate('NewCard')}>
                            <Text style={styles.useAnotherCard}>Use another card</Text>
                        </TouchableOpacity>
                    </View>
                    <View style={styles.paymentMethod}>
                        <View style={{ flexDirection: 'row', alignItems: 'center' }}>
                            <TouchableOpacity style={styles.radioBtn} onPress={() => setSelectedPaymentType('paynow')}>
                                {selectedPaymentType == 'paynow' ? <View style={styles.selected}></View> : null}
                            </TouchableOpacity>
                            <Text style={styles.paymentType}>Paynow</Text>
                        </View>
                        <SvgXml xml={paynow} style={{ marginLeft: 50, marginTop: 15 }} />
                    </View>
                    <Button
                        onPress={() => { setShowPrompt(true); props.setCartQuantity([]); props.setCartItems([]); }}
                        name={'Make Payment'}
                        style={{ backgroundColor: '#ffc82d', marginTop: 50, width: '100%' }} />
                </View>
                <Footer style={styles.footer} />
            </ScrollView >
        </View >
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        zIndex: 3,
        backgroundColor: "#FFFFFF",
        height: windowHeight,
        width: windowWidth,
        alignItems: 'center'
    },
    error: {
        fontFamily: 'Montserrat-Bold',
        color: '#FFFFFF',
        backgroundColor: '#ff7b7b',
        padding: 5,
        width: '70%',
        fontSize: 13,
        textAlign: 'center',
        marginBottom: 15,
        borderRadius: 5,
        position: 'absolute',
        zIndex: 15,
        top: 15
    },
    blackoverlay: {
        height: windowHeight,
        width: windowWidth,
        position: 'absolute',
        top: 0,
        zIndex: 20,
        backgroundColor: 'rgba(0,0,0,0.7)',
        alignItems: 'center',
        justifyContent: 'center'
    },
    promptBlock: {
        width: '80%',
        backgroundColor: '#FFFFFF',
        borderRadius: 30,
        padding: 30,
        alignItems: 'center',
        justifyContent: 'center'
    },
    delete: {
        alignSelf: 'flex-end',
        marginRight: 10,
        marginBottom: 10
    },
    deleteTxt: {
        fontSize: 25,
        color: 'rgba(128,128,128,1)',
        fontFamily: "Montserrat-SemiBold",
    },
    promptTitle: {
        fontFamily: 'Montserrat-SemiBold',
        color: '#2c2c2c',
        fontSize: 22,
        lineHeight: 30,
        textAlign: 'center',
        marginBottom: 30
    },
    promptSubtitle: {
        fontFamily: 'Montserrat-Regular',
        color: '#2c2c2c',
        fontSize: 16,
        lineHeight: 24,
        textAlign: 'center',
        marginBottom: 30
    },
    contentContainerStyle: {
        minHeight: windowHeight,
        width: windowWidth,
        backgroundColor: '#FFFFFF',
    },
    paymentWrap: {
        padding: 25
    },
    title: {
        fontFamily: 'Montserrat-SemiBold',
        color: '#121212',
        fontSize: 20,
        lineHeight: 41,
    },
    subtitle: {
        fontFamily: 'Montserrat-Regular',
        color: '#121212',
        fontSize: 17,
        lineHeight: 41,
        marginTop: 15,
        marginBottom: 20
    },
    paymentMethod: {
        flexDirection: 'column',
        marginBottom: 30
    },
    radioBtn: {
        width: 25,
        height: 25,
        backgroundColor: '#dedede',
        borderRadius: 50,
        alignItems: 'center',
        justifyContent: 'center'
    },
    selected: {
        width: 13,
        height: 13,
        backgroundColor: '#10af41',
        borderRadius: 50,
    },
    paymentType: {
        fontFamily: 'Montserrat-SemiBold',
        color: 'rgba(0,0,0,0.7)',
        fontSize: 16,
        lineHeight: 26,
        marginLeft: 25,
    },
    icon: {
        marginRight: 5
    },
    cardWrap: {
        flexDirection: 'row',
        alignItems: 'center',
        marginLeft: 50,
        marginTop: 15
    },
    yourcards: {
        fontFamily: 'Montserrat-Regular',
        color: '#000000',
        fontSize: 16,
        lineHeight: 26,
        marginLeft: 50,
        marginTop: 10,
    },
    censorCardnum: {
        width: 7,
        height: 7,
        marginRight: 3,
        borderRadius: 50,
        backgroundColor: '#c4c4c4'
    },
    cardnum: {
        fontFamily: 'Montserrat-Regular',
        color: '#000000',
        fontSize: 14,
        lineHeight: 20,
        marginLeft: 10
    },
    useAnotherCard: {
        fontFamily: 'Montserrat-SemiBold',
        color: '#b0b0b0',
        fontSize: 14,
        lineHeight: 26,
        textDecorationLine: 'underline',
    },
    footer: {
        position: 'absolute',
        bottom: 0,
    }
});

export default Payment;
